INSERT INTO `teaching_sharing` VALUES (9,'2019-02-28 15:25:16.492425','去年国家资助学生超9800万人次 资助金额超2000亿元','苦什么不能苦孩子穷什么不能穷教育，资助贫困家庭学生顺利完成学业，是教育脱贫攻坚工作的重要组成部分，是阻断贫困代际传递的治本之策。',1,17341114),(10,'2019-02-28 16:21:06.885988','国务院台湾事务办公室2月27日例行新闻发布会','制度不同，不是统一的障碍，更不是分裂的借口。“一国两制”的提出，本来就是为了照顾台湾现实情况，维护台湾同胞利益福祉。',1,15336121),(11,'2019-02-28 20:19:17.942179','习近平为第五批全国干部学习培训教材作序 要求加快推进马克思主义学习型政党学习大国建设','我们党依靠学习创造了历史，更要依靠学习创造未来。要加快推进建设马克思主义学习型政党，学习大国建设，坚持把学习习近平新时代社会主义思想作为重中之重。善于学习，就是善于进步，党的历史经验和现实发展告诉我们，没有全党大学习，没有干部大培训，就没有事业大发展。面对伟大斗争，伟大工程，伟大事业，伟大梦想的波澜',1,18340069),(12,'2019-02-28 20:25:46.610130','栗战书同人大代表座谈：认真履行宪法法律赋予职责','人大代表作为国家权力机关的组成人员，在我国的经济、政治与其他方面的社会生活中，发挥着重要作用。全国和地方各级人大代表，代表人民的利益和意志，依照宪法和法律赋予本级人大的各项职权，参加行使国家权力。人民代表大会在国家政权体系中处于主导和中心地位，是整个政权体系的基础。人民代表大会重大作用的发挥，依赖于',1,17341117),(13,'2019-02-28 20:29:23.879468','长江经济带三大城市群的“对话”：串起万里黄金水道的新使命','推动长江经济带发展，是党中央、国务院主动适应把握引领经济发展新常态、科学谋划中国经济新棋局作出的既利当前又惠长远的重大决策部署，对于实现“两个一百年”奋斗目标和中华民族伟大复兴的中国梦，具有重大现实意义和深远历史意义。牢固树立“创新、协调、绿色、开放、共享”的发展理念始终贯穿在长江经济带建设中，坚持',1,17341117),(14,'2019-02-28 20:36:08.652839','人民日报评论：把党的政治建设摆在首位','把党的政治建设应摆在首位，有利于维持党的活力、保持党的纯洁。近几年来党重拳反腐，一批“老虎”、“苍蝇”先后落马，体现了党反腐的决心、为人民服务的初心。',1,18340075),(15,'2019-02-28 20:37:00.471498','习近平：在新的起点上深化国家监察体制改革','深化国家监察体制改革是贯彻党的十九大精神、健全党和国家监督体系的重要部署，是推进国家治理体系和治理能力现代化的一项重要改革。抓贪官是治标，改革体制是治本，坚持标本兼治，方能巩固扩大反腐败斗争成果，将权力关进制度的笼子中',1,17341099),(17,'2019-02-28 20:40:45.481641','钟声：“中国绿”为地球添生机','我国大力推进生态文明建设，为世界环境保护事业作出了自己的贡献。为自己负责，也为世界负责，这是大国风范。中国绿，值得我们点赞。',1,18340075),(18,'2019-02-28 21:01:34.610875','每日金句|习近平论人才资源的重要性','如今中国特色社会主义进入了新时代，这是我国发展新的历史方位。面对新的国际形势，我国原有的粗放型发展方式已经不能适应新时代的要求，我们必须走实现创新型发展道路，而实现创新型发展，人才资源已成为最重要的战略资源，人才在综合国力竞争中越来越具有决定性意义',1,17341114),(19,'2019-02-28 21:11:33.643309','习近平总书记重要讲话引发两岸社会深思“一国两制”','两岸的和平统一是所有中华同胞共同的心愿，在新的历史起点上，大陆与台湾的联系的进一步加深是大势所趋。坚持一国两制，坚持九二共识，制度不同不是分裂的借口，只有合力探求友好的发展方式，促进统一才是富国强国、赢得未来的道路',1,17341097),(23,'2019-02-28 21:24:45.831620','《求是》杂志发表习近平总书记重要文章《在新的起点上深化国家监察体制改革》','深化国家监察体制改革的目标是构建集中统一、权威高效的国家监察体系，形成以党内监督为主、其他监督相贯通的监察合力。坚持推进国家监察体制改革，保证公权力的正确行使，促进干部为人民做实事。',1,16337174),(26,'2019-02-28 21:47:56.364831','长江经济带三大城市群的“对话”：串起万里黄金水道的新使命','自推动长江经济带发展座谈会召开以来，三年的时间内，三大长江流域城市群在不断探索如何实现长江经济带最大效益，城市之间慢慢形成产业合作、共同繁荣的发展模式，实践证明只有共享共建、转变传统产业才能实现高质量发展。',1,16337174),(27,'2019-02-28 21:57:16.780510','重点领域改革向纵深推进 进一步激发微观主体活力','进一步推进高质量发展，不单单只是追求gdp总值，而且健康全面的深度发展。在不破坏绿水青山的前提下，让企业与经济快速切稳步的发展，创造更有意义的金山银山！以增强微观主体活力为重点，推动相关改革走深走实，深刻领会高质量发展内涵。同时加强人才培养，因为人才资源是第一资源，也是创新活动中最为活跃、最为积极的',1,18340060),(28,'2019-03-01 08:00:10.423276','康震讲《唐诗宋词的风骨气韵》之《芙蓉楼送辛渐》','即景生情，寓情于景，含蓄蕴藉，韵味无穷。自比冰壶，表达自己开朗胸怀和坚强性格。我觉得老师讲的十分好！',1,17341114),(29,'2019-03-01 08:53:19.886900','防范化解各领域重大风险，习近平有明确要求','总书记在讲话中提出全党要增强“四个意识”、坚定“四个自信”、做到“两个维护”，自觉在思想上政治上行动上同党中央保持高度一致，要养成防患未然的忧患意识。如果我们不学时政就容易迷失方向，就好比不学业务不会说行话，不敢想就不敢干，这样永远无法成功。',1,17341074),(30,'2019-03-01 09:06:15.280621','全国红色故事讲解员大赛集中展示活动在上海举行','“传承红色基因，弘扬革命精神”。在当今社会，许多人的思想受到当下流行文化，国外不符我国国情文化等冲击，造成了价值观上的一些歪曲，如前段时间摸黑革命英雄历史事迹等事件。全国红色故事讲解员大赛的举办，无疑是对广大民众普及红色故事、用红色故事感染人们的绝佳机会',1,17341073),(31,'2019-03-01 09:37:52.887509','习近平：在新的起点上深化国家监察体制改革','深化国家监察体制改革是贯彻党的十九大精神、健全党和国家监督体系的重要部署，是推进国家治理体系和治理能力现代化的一项重要改革。这一举措有利于党对反腐败工作的统一领导，有利于对公权力监督的全覆盖，有利于坚持标本兼治、巩固扩大反腐败斗争成果。',1,18340069),(32,'2019-03-01 11:45:49.369749','长江经济带三大城市群的“对话”：串起万里黄金水道的新使命','一条大江，将全国大约40%的人口紧密的联系在了一起。川渝，鄂，江浙沪皖，这三大城市群，拥有雄厚的经济的基础。曾经他们各自发展自己的经济，进行竞争比拼，经济发展得到了高速发展，而如今中国已经进入了新时期，曾经的发展方式似乎已经不完全适合。各个省市之间，应该合作起来互帮互助！最为典型的即是川渝由曾经的相背而行，到如今的互帮互助，重庆利用自己直辖市的优势帮助四川贫困人口，增加收入。四川则利用自己资源丰富的优势为重庆提供原料！相信长江流域在这样的氛围下会更好更快的发展',1,18340060),(33,'2019-03-01 16:20:13.201703','反家庭暴力法实施三周年 越来越多的家暴受害者敢于求助','家暴现象往往受到陈腐落后的观念影响。反家庭暴力法对家庭暴力的清晰界定和对家庭暴力零容忍的鲜明态度，使社会公众不再单纯地把家庭暴力视为不可言说的家庭丑事和家庭私事。受害者要敢于维权，且掌握搜集证据等手段。而对于社会公众，每个人都应知道自己有权中止家暴，敢于和善于遏制暴力言行和协助受害者。',1,17341099),(34,'2019-03-01 16:23:55.166236','江西省委宣传部黄璜问：如何从网络大国迈向网络强国？','信息时代的到来，网络技术对强国有着至关重要的作用，对于政治建设更有巨大作用。中国网民数量庞大，活用网络，对科技，对民生都有巨大的帮助。',1,17341097),(35,'2019-03-01 18:28:28.281576','集中力量支持深度贫困地区脱贫攻坚——一份来自全国人大常委会专题调研组的报告','2020年要实现全面小康，剩下一千六百多万贫困人口，是一件不容易的事。要做到真脱贫，越往后困难就越大，扶贫难度递增，返贫几率递增。但是我觉得，越是到最后关键时刻，越是会有更多的人会参与到扶贫事业中，实现全部贫困人口脱贫也会更有希望。',1,18340075),(36,'2019-03-01 19:00:05.923601','农业农村部：扶持小农户 发展现代农业','推动小农户的现代化改造，实现小农户与现代化农业接轨，更有利于提高乡村发展建设质效，加快乡村振兴步伐。尤其是在当下农村青壮年多在城市务工，老弱妇幼成为农业生产主力的前提下，加快小农户与现代化农业衔接的意义则更为重大。',1,17341117),(37,'2019-03-01 19:04:40.799525','全国红色故事讲解员大赛集中展示活动在上海举行','红色文化蕴涵了党在长期领导中国革命与建设的伟大实践中所创造和积累的丰富历史经验，包括重要革命纪念地、纪念物、标志物及其所承载的革命历史、革命精神等，其中包含的革命历史、革命传统精神和党的理想信念等都是对广大党员开展党性教育的独特资源',1,17341117),(38,'2019-03-01 21:09:18.604589','习近平在中央党校（国家行政学院）中青年干部培训班开班式上发表重要讲话','培养选拔优秀年轻干部是一件大事，关乎党的命运、国家的命运、民族的命运、人民的福祉，是百年大计。政治上的坚定、党性上的坚定都离不开理论上的坚定。这就要求我们加强理论学习，掌握和运用辩证唯物主义和历史唯物主义，掌握贯穿其中的马克思主义立场、观点、方法，深入认识共产党执政规律、社会主义建设规律、人类社会发展规律。',1,18340069),(39,'2019-03-01 21:13:57.070057','新时代全面依法治国的根本遵循','依法治国对国家的发展有着极为重要的意义。法律时刻保障着人民的切身利益。普及法律知识，健全法律体制，让制度更优，让人民法律意识更深，对营造和谐社会大环境十分重要。学法知法，从群众起。',1,17341097),(40,'2019-03-02 13:21:00.809360','31省份2018年GDP出炉 18地增速跑赢全国','在过去的2018年中，我国的GDP总值在整体上仍然是处于稳定增长的形式！值得一提的事广东省与江苏省两省以九万亿的GDP总值领跑全国，将第三名的山东省远远甩到身后。同时，东西部的差距仍然很大，但是从增长速率西部地区的速率快于东部地区，由此看来东西部差距正在不断地缩小。中国正在向更好的方向发展',1,18340060),(46,'2019-03-02 14:36:09.334076','全军部队贯彻落实习近平主席全国两会重要讲话精神纪实','近年来，人民军队不断实现历史性的跨越。聚焦强军目标，踏上强军兴军新征程，人民军队取得历史性成就、发生历史性变革，国防和军队建设进入新时代。人民军队正以时不我待、只争朝夕的紧迫感和使命感，朝着实现党在新时代的强军目标、全面建成世界一流军队阔步前行。',1,18340076),(47,'2019-03-02 14:49:19.088686','习近平：在新的起点上深化国家监察体制改革','深化国家监察体制改革是推进国家治理体系和治理能力现代化的一项重要改革。目前，我国监察体制改革已初显成效。因此，更要进一步深化改革，完善纪检监察体制机制，使制度更加完善有效。',1,18340076),(48,'2019-03-02 15:06:52.669585','人民日报评论：年轻干部要加强理论修养 不断修炼自我','“一年之计，莫如树谷；十年之计，莫如树木；终身之计，莫如树人。”实现中华民族伟大复兴，坚持和发展中国特色社会主义，关键在党，关键在人，归根到底在培养造就一代又一代可靠接班人，时代的接力棒最终要交接到我们这一代青年的手里。我们要强化自我修炼、自我约束、自我学习。我们应该深刻学习习近平新时代中国特色社会主义思想，时时对照、躬身践行，才能不断自我完善、自我提高。',1,17341074),(49,'2019-03-02 18:14:54.264111','每日金句|习近平论理论学习','要紧密结合新时代新实践，紧密结合思想和工作实际，有针对性地重点学习，多思多想、学深悟透，知其然又知其所以然。实事求是，与时俱进，是党的指导思想活的灵魂',1,15336121),(50,'2019-03-02 18:42:41.246299','全军部队贯彻落实习近平主席全国两会重要讲话精神纪实','军队是国家的守卫者，寄托着全国人民的期望，同时军人更是全国人民心灵的一处港湾，他们既背负着护国职责，更是有着道德重任。全军部队贯彻习近平总书记全国两会重要讲话精神，既是为了提高军人们整体素质，也让人民对于军队更加信任',1,17341073),(51,'2019-03-02 19:24:53.592219','中央政治局同志向党中央和习近平总书记述职','近期，中央政治局通知按规定向党中央和习近平总书记书面述职。十九