脚痛医脚，必须统筹谋划，探索行之有效的思路和打法。党的十八届三中全会翻开了以勇气为桨、以创新为帆，长风破浪的改革新篇，用成功实践彰显出其划时代的伟大意义。',1,17341096),(78,'2019-03-04 18:49:45.696795','人民日报评论：坚持知行合一 主动担当作为','根据习近平总书记在中青年干部会议上的讲话，我深刻体会到要实现中华民族伟大复兴，绝不是轻轻松松、敲锣打鼓就能实现的。时时刻刻提醒自己要牢记空谈误国、实干兴邦的道理，坚持知行合一、真抓实干，做实干家。所谓的坚持知行合一， 主动担当作为，扛起责任与使命。',1,17341074),(79,'2019-03-04 18:49:45.707321','习近平等党和国家领导人出席全国政协十三届二次会议开幕会','今年的政协报告展现了新时代人民政协的新面貌新气象，过去的一年中，政协全面贯彻中共十九大精神，推动各项工作取得新进展。今年是新中国成立70周年，也是人民政协成立70周年，相信政协将会为全面建设小康社会、实现中华民族伟大复兴中国梦贡献更大的力量！',1,16337174),(80,'2019-03-04 18:49:54.659850','供给侧结构性改革再迎“提质升级” 重点领域有望破局','未来在推进供给侧结构性改革的过程中，要增加改革的针对性、灵活性、有效性和精准性，更多满足市场、用户、消费者的个性化、多元化、差异化需求，使得供给侧结构性改革具备持续长久推动经济增长的能力。',1,17341096),(81,'2019-03-04 18:54:57.349112','新华社评论：会上看承诺，会后重落实','两会期间，数场“部长通道”采访活动备受关注。凝聚民心、彰显决心、增强信心，两会继续开通部长级工作。会上看承诺，会后看落实。不少去年全国两会“部长通道”上的承诺得到了兑现。相信这种改革的体质建设将继续带来新愿景、新承诺，为共创更加美好的未来展现新作为。',1,17341074),(82,'2019-03-04 18:56:51.394155','听总书记讲新时代学雷锋','社会在发展进步，但雷锋精神却永远不会过时。雷锋精神是崇高的，有时代意义的。如果每个人都能学习雷锋精神，将奉献精神，将爱心给予他人，社会会越来越美好。',1,17341097),(83,'2019-03-04 19:03:34.227887','听总书记讲新时代学雷锋','在现代社会雷锋精神依旧有着深刻的社会价值，志愿活动尤其体现这种精神，作为社会贡献的前行者和引领者，充分践行了社会主义核心价值体系，是社会的宝贵财富',1,16337112),(84,'2019-03-04 19:04:11.339582','重要事业、重要战线！习近平谈文艺、社科工作','文艺事业是党和人民的重要事业，实现中华民族的伟大复兴需要发挥文艺和文艺工作者的重要作用。在国家着力构建中国特色哲学社会科学的同时文艺工作者也需要做真善美的追求者和传播者，自觉与人民同呼吸共命运。',1,16337112),(85,'2019-03-04 19:08:23.453768','钟声：读懂中国与世界共同发展的内在逻辑','中国的日益强盛使得在经济全球化的环境下，越来越多的国际人士聚焦中国，试图从中国的发展策略、治国理念中寻找启示。在决胜全面建成小康社会第一个百年奋斗目标的关键之年，中国必将向世界展现出巨大的潜力，为推动世界经济发展贡献力量。',1,16337174),(86,'2019-03-04 19:09:01.563235','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','随着中国的发展与富强，中国特色社会主义的道路也在不断延伸，其思想内涵也在不断丰富与发展。中国特色社会主义取得的成就大家有目共睹，只有坚持下去，才是实现中华民族伟大复兴的正确道路。而要发展下去，就要坚持以民为本，为人民谋求福利。我相信，睡着制度的不断完善，中国的社会主义之路将越走越好！',1,17341097),(87,'2019-03-04 19:14:11.968998','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','必须长期坚持习近平新时代中国特色社会主义思想、坚持用习近平新时代中国特色社会主义思想武装全党是灵魂，应该成为我们重要的思想武器，要贯穿在其他每个部分中。坚持用习近平新时代中国特色社会主义思想武装全党是有实际含义的，包含进一步解放思想的要求。',1,16337106),(88,'2019-03-04 19:15:32.554138','第八讲：以人民为中心是新时代坚持和发展中国特色社会主义根本立场','第八讲，即强调坚持以人民为中心。其中提到，人民对美好生