1,16337112),(97,'2019-03-04 21:49:26.916049','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','习近平新时代中国特色社会主义思想，是党和人民实践经验和集体智慧的结晶，内涵十分丰富，包括新时代坚持和发展中国特色社会主义的总目标、总任务、总体布局、战略布局和发展方向、发展方式、发展动力、战略步骤、外部条件、政治保证等方面的基本问题，对中国社会的方方面面和党的建设等各个方面作出理论分析和政策指导，是党和国家必须长期坚持的指导思想。',1,16337174),(98,'2019-03-04 22:03:24.134731','辽宁打造新时代学雷锋高地','雷锋是时代的楷模，雷锋精神是永恒的。实现中华民族伟大复兴，需要更多时代楷模。我们既要学习雷锋的精神，也要学习雷锋的做法，把崇高理想信念和道德品质追求转化为具体行动，体现在平凡的工作生活中，作出自己应有的贡献，把雷锋精神代代传承下去。',1,17341099),(99,'2019-03-04 22:05:13.614512','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','经过长期探索，我们已经找到一条适合中国国情的正确发展道路，中国特色社会主义是中国共产党和中国人民团结的旗帜、奋进的旗帜、胜利的旗帜。一个国家的发展道路合不合适，只有这个国家的人民才最有发言权。改革开放以来，党团结带领全国各族人民，高举中国特色社会主义伟大旗帜，不懈奋斗，推动我国经济实力、科技实力、国防实力、综合国力进入世界前列，推动我国国际地位实现前所未有的提升，中华民族正以崭新姿态屹立于世界的东方。只要我们紧紧依靠13亿多中国人民，坚定不移走自己的路，我们就一定能战胜一切艰难险阻，不断取得新的成绩...',1,16337191),(100,'2019-03-04 22:30:17.987424','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','中国特色社会主义思想是党和人民经过长期努力奋斗，取得的宝贵成果。改革开放以来，党和国家取得一切成绩和进步的根本原因，归结起来就是：开辟了中国特色社会主义道路，形成了中国特色社会主义理论体系，确立了中国特色社会主义制度，发展了中国特色社会主义文化，这是中国特色社会主义的根本标志。习近平强调“一切向前走，都不能忘记走过的路……面向未来，面对挑战，全党同志一定要不忘初心、继续前进”，我们要更加自觉地坚定这四个方面的自信，即道路自信、理论自信、制度自信、文化自信。',1,16337174),(101,'2019-03-04 22:47:59.535015','120倍偿还50年前欠款 浙江乌镇98岁“诚信奶奶”冒雨还债','人无信不立。诚信是做人的基本准则，失去诚信，人就无法在社会立足;拥有诚信，就拥有了立足之本。国无信无以自强。国家机构、国家领导也要处处以诚信为本，不弄虚作假，不负人民期望。如此人民更有幸福感，国家更富盛强。',1,18340075),(102,'2019-03-04 23:01:11.254675','我国今年计划发射8-10颗北斗导航卫星','我国北斗系统的不断完善、不断进步，一方面体现我国对自研技术的重视，另一方面体现我国日益进步的科研力量。钻研自主知识产权的技术，不再依赖外国，是我国迈向科技强国的必经之路，也是中华民族伟大复兴的必由之路。相信在未来的5G时代，我们会有更多属于自己的技术，自力更生迈向未来。',1,18340075),(103,'2019-03-04 23:11:26.972937','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','每个时代都需要引领性的思想理论。习总书记的思想是在马克思列宁主义，毛泽东思想，邓小平理论，三个代表重要思想科学发展观的基础上从2013年开始逐步建立完善起来的，直到2017年底才基本成型，有了自己的内核。新时代理论突出体现了与时俱进，不断前进的理念。必须长期坚持新时代中国特色社会主义思想，这样中国特色社会主义道路才会越走越好',1,17341105),(104,'2019-03-04 23:15:22.052430','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','历史已经证明无论是君主立宪制还是民主共和制都不适合中国的发展。无论是洋务运动，戊戌变法，辛亥革命，还是照搬照抄苏联的社会主义制度，都救不了中国。只有坚持和发展中国特色社会主义，才是中国发展进步的根本方向。只有坚持“四个自信”，不忘初心，继续前进，我们的国家才能迅速发展，更快走向社会主义现代化',1,17341105),(105,'2019-03-04 23:57:36.116885','听总书记讲新时代学雷锋','积小善为大善，善莫大焉，这和我们党‘为人民服务’‘做人民勤务员’是一脉相承的，所以雷锋精神永远值得弘扬。”党的宗旨是为人民服务，雷锋精神完美阐释了党的宗旨，是我们所有人值得学习的。',1,15336121),(106,'2019-03-05 00:07:54.745128','第一讲：习近平新时代中国特色社会主义思想是党和国家必须长期坚持的指导思想','任何一种思想的确立，都有其内在的理论逻辑。作为马克思主义中国化最新成果和中国共产党人新的行动指南，习近平新时代中国特色社会主义思想更是一个集时代性、原创性与系统性于一体的科学体系。习近平新时代中国特色社会主义指导思想的逐步完善让中国特色社会主义制度进一步发展，我们应始终高举中国特色社会主义的旗帜，坚定不移地走中国特色社会主义，坚持党的领导，我们才能实现中华民族的伟大复兴，建成富强民主文明和谐美丽的社会主义工业化强国',1,15336121),(107,'2019-03-05 00:15:54.490026','第二讲：坚持和发展中国特色社会主义是当代中国发展进步的根本方向','只有社会主义才能救中国，只有坚持和发展中国特色社会主义才能实现中华民族伟大复兴。坚持和发展中国特色社会主义是改革开放以来党的全面理论和实践的主题，是当代中国发展进步的根本方向。习近平总书记指出，中国特色社会主义是党和人民长期奋斗、创造、积累的根本成就。经过长期努力，中国特色社会主义进入了新时代，这是我国发展新的历史方位。新时代新作风，中国特色社会主义进入了新的历史时期并不是说我们要改变我们的道路，而是应该继续坚持和发展中国特色社会主义，继续坚持党的领导',1,15336121),(108,'2019-03-05 11:53:32.643423','风正帆悬——人民政协 70年再出发','2019年，人民政协将迎来70周年华诞，要把加强思想政治引领、广泛凝聚共识作为履职工作的中心环节，加强各党派团体、各族各界人士大团结大联合，担负起把中共中央对人民政协工作的要求落实下去、把海内外中华儿女实现中华民族伟大复兴中国梦的智慧和力量凝聚起来的政治责任，以优异成绩迎接新中国成立70周年。',1,18340069),(109,'2019-03-05 11:55:21.991497','代表委员畅谈新中国七十年辉煌历程：可爱的中国（社会建设篇）','新中国成立七十年来，党和国家始终坚持在发展中保障和改善民生，全面推进幼有所育、学有所教、劳有所得、病有所医、老有所养、住有所居、弱有所扶，不断改善人民生活、增进人民福祉。全面建成小康社会惠及十几亿人口，是实现中华民族伟大复兴的重要基础和关键一步，是每一个中国人的幸福所在、责任所在。',1,17341074),(110,'2019-03-05 11:56:07.798583','为党和人民继续前进提供强大精神激励——全国政协文艺界社科界委员畅谈聆听习近平总书记讲话心得','习近平总书记指出:一切优秀文艺工作者的艺术生命都源于人民，一切优秀文艺创作都为了人民。当今时代文艺作品必须具有振奋人心、催人奋进的力量。那些优秀的文艺作品代表着时代进步的思想，理应再次吹响了以文化自信为底蕴、以伟大灵魂和作品为动力，为党和人民继续前进提供强大精神激励的进军号角。',1,17341074),(111,'2019-03-05 11:56:52.780399','国务院办公厅关于成立中国国际进口博览会组委会的通知','国务院办公厅着手组建中国国际进口博览会组委会，标志着在经济全球化、货物互通往来的当下，我国政府积极融入时代潮流，并争做时代领航员的决心，此次国际进口博览会组委会的组建，将推动落实我们国家邀请其他国家、地区和国际组织参展，也有助于提升我国的国际地位',1,17341073),(112,'2019-03-05 11:58:12.082831','第二十九讲：努力掌握马克思主义思想方法和工作方法','“八个坚持”的思想方法和工作方法是对习近平总书记强调的思维方法的发展，实事求是、问题导向与调查研究其实是一回事，搞清楚“实事”要认真调查研究，“求是”才能解决问题，实事求是的方法在于不断解放思想，解放思想的实质是厚今薄古，讲发展必须讲马克思主义中国化的其他成果，他们的历史使命已经完成，有益成分已经吸收到新思想中，讲思想武装与指导实践必须明确强调新思想。',1,16337106),(113,'2019-03-05 11:58:22.222864','第二十七讲：促进“一带一路”国际合作','方略论是新思想的主要内容，其他各讲共同构成方略论，其中包括理念论以及各方面建设内容，具体剖析如下。理念论除了新发展理念还包括全面深化改革、全面开放、法治国家，这些都具有指导思想的意义。值得注意的是，由全面扩大开放到形成全面开放新格局的提法是重要变化。',1,16337106),(114,'2019-03-05 20:10:07.445075','习近平：在新的起点上深化国家监察体制改革','党的十八大以来对国家监察体制进行了改革，党对反腐败工作的统一领导加群，进一步实现了对公权利监督的全覆盖，坚持了标本兼治，巩固扩大了反腐斗争成果。',1,16337112),(115,'2019-03-05 20:10:30.037055','习近平：加强党对全面依法治国的领导','党的十八大以来，提出一系列全面依法治国新理念新思想新战略，明确了全面依法治国的指导思想、发展道路、工作布局、重点任务，是马克思主义法治思想中国化的最新成果，是全面依法治国的根本遵循，必须长期坚持、不断丰富发展。',1,16337112),(116,'2019-03-05 20:11:38.892555','第三讲：实现中华民族伟大复兴是近代以来中华民族最伟大的梦想','中国共产党人的初心和使命就是为中国人民谋幸福、为中国民族谋复兴。中国共产党是为人民谋利益的政党，具有统一的动员组织能力，积累了实现中华民族伟大复习的丰富经验，义务反顾肩负起中华民族伟大复兴的历史使命。我们也要为实现国家富强、民族振兴、人民幸福而努力奋斗。',1,16337112),(117,'2019-03-05 20:12:07.609672','第四讲：党和国家事业历史性、根本性的变革和成就','面对世界经济持续低迷，发展不均衡、不可持续问题突出，国内经济“三期叠加”，十八大以来党和国家事业进行了历史性变革，有效提高了国家机构依法履职能力，有效促进了社会公平正义，维护了人民群众合法权益，显著增强了党运用法律手段和治理国家的能力。',1,16337112),(118,'2019-03-05 22:34:45.790200','以精品奉献人民，用明德引领风尚','科技进步和创新是增强综合国力的决定性因素，世界范围内的竞争、综合国力的竞争，关键是科学技术的竞争，教育是培养人才的基础，对经济和发展具有先导性、全局性，增强创新能力关系到中华民族的兴衰存亡，创新是一个民族的灵魂，是一个国家兴旺发达的不竭动力。',1,17341117),(119,'2019-03-05 22:35:10.996409','【央视快评】与人民心心相印 与人民团结奋斗','中国人民的伟大团结精神是在历史继承中形成的，这种历史继承既包括对中国传统文化的继承，也包括对马克思主义和中国共产党在实践中形成的红色文化的传承。传承好伟大团结精神需要有伟大目标指引、伟大道路落实和伟大政党带领。发展好伟大精神要继续推动党的伟大团结、人民的伟大团结和民族的伟大团结。',1,17341117),(120,'2019-03-05 22:36:06.601614','为党和人民继续前进提供强大精神激励——全国政协文艺界社科界委员畅谈聆听习近平总书记讲话心得','文艺作品的创作与时代的发展息息相关，好的文艺作品能够代表一个时代的风貌，引领一个时代的风气，烙下时代的印记。文艺工作者应该铭记以人民为中心，创作接地气的好作品，真正用心弘扬中国特色社会主义新时代的伟大精神。',1,16337174),(121,'2019-03-05 22:36:18.519138','【央视快评】与人民心心相印 与人民团结奋斗','我们党一直强调人民当家做主，而党也始终坚持人民的主体地位，坚持为人民服务。过去的一年，十三届全国人大及其常委会，坚持党的领导，为人民认真履职，推进了社会各行各业的立法工作，密切联系群众，广纳群言，实现了良好开局。',1,16337174),(122,'2019-03-05 22:51:17.811035','听总书记讲新时代学雷锋','雷锋精神，人人可学；奉献爱心，处处可为。积小善为大善，善莫大焉。当有人需要帮助时，大家搭把手、出份力，社会将变得更加美好。这和我们党\"为人民服务’‘做人民勤务员’是一脉相承的，所以雷锋精神永远值得弘扬。',1,17341096),(124,'2019-03-06 00:03:41.748677','助推经济高质量发展 新型基建将是2019年投资重点','做好顶层设计和政策协调，避免出现盲目建设、重复建设甚至是恶性竞争的情况；要着力引入民间资本参与新型基础设施建设，形成多元化的投融资体系，并加快探索新型基础设施建设的商业可持续模式，做到风险可控。',1,17341096);
